import React, { Component } from 'react';
import App from './App';

class Status extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className='status-box'>
        <form>
          <h4>Create a post</h4>
          <input type='text'></input>
          <input type='submit' value='Post' className='submit-button'></input>
          </form>
      </div>

    )
  }
}

export default Status;
